style.css:
/* Reset some default styles for better consistency */
body, h1, h2, p, ul {
  margin: 0;
  padding: 0;
}

/* Apply the background color and font to the body */
body {
  background-color: #f19cbb;
  font-family: 'Futura', Arial, sans-serif;
  color: #333; /* Set text color to a contrasting color */
}

/* Style the header */
header {
  background-color: #333;
  color: #fff;
  padding: 10px;
  text-align: center;
}

/* Style the navigation bar */
nav {
  background-color: #444;
  padding: 10px;
}

nav ul {
  list-style: none;
  margin: 0;
  padding: 0;
}

nav li {
  display: inline-block;
  margin-right: 15px;
}

nav a {
  text-decoration: none;
  color: #fff;
  font-weight: bold;
}

/* Style the main content area */
main {
  padding: 20px;
}

/* Add some styling to links */
a {
  color: #007bff;
}

a:hover {
  text-decoration: underline;
}
